import React from 'react';
import { useSelector } from 'react-redux';

const TestPage = () =>{
    const data = useSelector((state) => state.allUsersData.data);
    console.log("=====<<<<", data)
    return(
        <React.Fragment>
            <div style={{marginLeft:'300px'}}>
                <h1>Data is comming</h1>
                <ul>
                    {data.map((item) => (
                    <li key={item}>
                        {item.name}
                    </li>
                    
                    ))}
                    
                </ul>
            </div> 

        </React.Fragment>
    );
}
export default TestPage;
